-- Script de inicialización de Base de Datos para Valuador de Vehículos

-- 1. Tabla Transaccional: Registro histórico de cada publicación extraída
CREATE TABLE IF NOT EXISTS extractions (
    id SERIAL PRIMARY KEY,
    fecha_transaccion TIMESTAMP WITH TIME ZONE DEFAULT CURRENT_TIMESTAMP,
    brand VARCHAR(100),
    model VARCHAR(100),
    version VARCHAR(255),
    year INTEGER,
    km INTEGER,
    price NUMERIC,
    currency VARCHAR(10),
    title TEXT,
    combustible VARCHAR(50),
    transmision VARCHAR(50),
    zona TEXT,
    fecha_publicacion VARCHAR(100),
    reservado BOOLEAN,
    url TEXT,
    site VARCHAR(50) -- kavak, meli, etc.
);

-- 2. Tabla de Resultados: Comparativa de Stock vs Mercado
CREATE TABLE IF NOT EXISTS stock_comparison (
    patente VARCHAR(20) PRIMARY KEY,
    marca VARCHAR(100),
    modelo VARCHAR(255),
    anio INTEGER,
    km INTEGER,
    descripcion TEXT,
    precio_venta NUMERIC,
    dif_pv_pm NUMERIC, 
    precio_toma NUMERIC,
    index_val NUMERIC, 
    ancianidad_actualizada NUMERIC,
    margen_hist_costo_pm NUMERIC,
    margen_idx_costo_pm NUMERIC,
    pm NUMERIC, 
    ml NUMERIC, 
    dif_pv_co_kavak NUMERIC,
    
    kavak NUMERIC,
    meli NUMERIC,
    tienda_cars NUMERIC,
    motor_max NUMERIC,
    auto_city NUMERIC,
    randazzo NUMERIC,
    
    depreciacion_apreciacion_km NUMERIC,
    cuenta NUMERIC
);

-- 3. Histórico de Tipo de Cambio
CREATE TABLE IF NOT EXISTS dolar_value (
    id SERIAL PRIMARY KEY,
    casa VARCHAR(50),
    nombre VARCHAR(100),
    compra NUMERIC,
    venta NUMERIC,
    fecha_actualizacion TIMESTAMP WITH TIME ZONE,
    fecha_carga TIMESTAMP WITH TIME ZONE DEFAULT CURRENT_TIMESTAMP
);

-- Índices para optimizar búsquedas
CREATE INDEX IF NOT EXISTS idx_stock_lookup ON stock_comparison (marca, anio, modelo);

